-- Clean Up

drop table if exists Comments;
drop table if exists Likes;
drop table if exists Roles;
drop table if exists Relationships;
drop table if exists Posts;
drop table if exists Users;
drop table if exists Zips;

-- Tables

create table Zips (
  zip integer primary key,
  municipalityID integer not null,
  city varchar not null
);

create table Users (
  ID integer primary key,
  name varchar not null,
  zip integer not null references Zips(zip)
);

create table Relationships (
  fromID integer references Users(ID),
  toID integer references Users(ID),
  primary key (fromID, toID)
);

create table Roles (
  fromID integer,
  toID integer,
  role varchar not null,
  primary key (fromID, toID, role),
  foreign key (fromID, toID) references Relationships(fromID, toID)
);

create table Posts (
  ID integer primary key,
  posterID integer not null references Users(ID),
  time timestamp not null,
  text varchar not null,
  url varchar null,
  unique (ID, posterID)
);

create table Likes (
  userID integer references Users(ID),
  postID integer references Posts(ID),
  primary key (userID, postID)
);

create table Comments (
  ID integer primary key,
  postID integer not null,
  posterID integer not null,
  userID integer not null,
  text varchar not null,
  foreign key (userID, posterID) references Relationships(fromID, toID),
  foreign key (postID, posterID) references Posts(ID, posterID)
);

-- Avoid Overhead

\set CLIENT_ENCODING 'UTF8'
\set AUTOCOMMIT off

-- Data
DELETE FROM Comments where PostID = 35;

COMMIT;
